\Delta A_{\Gamma} = A_{\Gamma}(KK) - A_{\Gamma}(\pi\pi) = \Delta A_{D} y\cos\phi + (A_{M}+A_{D})y\Delta\cos\phi - x\Delta\sin\phi.
\end{equation}

